import { Routes, BrowserRouter as Router, Route, Link, HashRouter } from "react-router-dom";
import './App.scss';
import Nav from './components/nav';
import Home from './pages/Home/HomeTronosPage';
import Personajes from './pages/PersonajesPages'
import Casas from './pages/Casas/CasasPages'
import Cronologia from './pages/Cronologia/CronologiaPage'
import CasasDetail from "./pages/CasasDetalle/CasaDetailPage";
import PersonajeDetail from "./pages/PersonajeDatailPage";
import VolverCasas from "./components/VolverCasas";
import VolverPersonajes from "./components/VolverPersonajes";
import VolverHome from "./components/VolverHome"

function App() {
  return (
   <Router>
     <Routes>
     <Route path="/" element={<Home/>}/>
     <Route path="/Personajes" element={<Personajes/>}/>
     <Route path="/Casas" element={<Casas/>}/>
     <Route path="/Cronologia" element={<Cronologia/>}/>
     <Route path="/CasasDetail/:id" element={<CasasDetail/>}/>
     <Route path="/PersonajeDetail/:id" element={<PersonajeDetail/>}/>
     <Route path="/Personajes" element={<VolverPersonajes/>}/>
<Route path="/" element={<VolverHome/>}/>

     </Routes>


   </Router>

  );
//  ( <Route>
//   <Routes>
//   <Route path="/Casas" element={<VolverCasas/>}/>
//   </Routes>
//   <VolverCasas/>
// </Route>

// );

}

export default App;
